import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './ImDrinking.css';
import Navbar from '../components/Navbar';

export default function ImDrinking() {
  const [drinkOptions, setDrinkOptions] = useState([]); // Fetched from DB
  const [selectedDrink, setSelectedDrink] = useState('');
  const [bodyInfo, setBodyInfo] = useState('');
  const [mixes, setMixes] = useState([
    { drink: '', percentage: '' },
    { drink: '', percentage: '' }
  ]);
  const navigate = useNavigate();

  // Fetch drink options from the backend (assumes endpoint /drinks returns JSON)
  useEffect(() => {
    async function fetchDrinks() {
      try {
        const res = await fetch('/drinks', { credentials: 'include' });
        if (res.ok) {
          const data = await res.json();
          // Assume data is an array of drink objects with a "name" property.
          setDrinkOptions(data);
        } else {
          console.error('Failed to fetch drinks:', res.status);
        }
      } catch (err) {
        console.error('Error fetching drinks:', err);
      }
    }
    fetchDrinks();
  }, []);

  // When a drink is selected, update personalized body info (replace with your own calculation)
  const handleDrinkChange = (e) => {
    const drink = e.target.value;
    setSelectedDrink(drink);
    setBodyInfo(`Personalized info for ${drink}: [Your metabolic/tolerance details here]`);
  };

  // Handle changes in mixes dropdowns and percentage inputs.
  const handleMixChange = (index, field, value) => {
    const newMixes = [...mixes];
    newMixes[index][field] = value;
    setMixes(newMixes);
  };

  // Add a new mix row.
  const addMix = () => {
    setMixes([...mixes, { drink: '', percentage: '' }]);
  };

  // Submit handler – for example, navigate to a diagram page (passing the selected drink)
  const handleSubmit = (e) => {
    e.preventDefault();
    if (!selectedDrink.trim()) return;
    // You can validate mix percentages here if desired.
    navigate(`/drink-diagram?drink=${encodeURIComponent(selectedDrink)}`);
  };

  return (
    <div className="im-drinking-container">
      <Navbar onSignOut={() => {
        localStorage.removeItem('bacshotsUser');
        window.location.href = '/signin';
      }} />
      <div className="im-drinking-content">
        <h1>I'm drinking</h1>
        <form onSubmit={handleSubmit}>
          <div className="drink-dropdown-section">
            <select 
              className="custom-dropdown"
              value={selectedDrink} 
              onChange={handleDrinkChange}
            >
              <option value="" disabled>Select a drink</option>
              {drinkOptions.map((drink, idx) => (
                <option key={idx} value={drink.name}>{drink.name}</option>
              ))}
            </select>
          </div>
          {bodyInfo && (
            <div className="body-info">
              {bodyInfo}
            </div>
          )}
          <div className="mixes-section">
            <h2>Mixes</h2>
            {mixes.map((mix, index) => (
              <div key={index} className="mix-item">
                <select
                  className="custom-dropdown mix-dropdown"
                  value={mix.drink}
                  onChange={(e) => handleMixChange(index, 'drink', e.target.value)}
                >
                  <option value="" disabled>Select a drink</option>
                  {drinkOptions.map((drink, idx) => (
                    <option key={idx} value={drink.name}>{drink.name}</option>
                  ))}
                </select>
                <input
                  type="number"
                  className="mix-percentage"
                  placeholder="Percentage"
                  value={mix.percentage}
                  onChange={(e) => handleMixChange(index, 'percentage', e.target.value)}
                />
              </div>
            ))}
            <button type="button" className="add-mix-btn" onClick={addMix}>+</button>
          </div>
          <button type="submit" className="submit-btn">Next &gt;</button>
        </form>
      </div>
    </div>
  );
}
